import React from "react";

export default function Preview({ children, onClose }) {
  return (
    <div
      style={{
        border: "2px solid #007bff",
        borderRadius: "10px",
        padding: "20px",
        background: "#f8f9fa",
      }}
    >
      <h3>Live Preview</h3>
      <button
        onClick={onClose}
        style={{
          float: "right",
          background: "red",
          color: "white",
          border: "none",
          borderRadius: "5px",
          padding: "5px 10px",
          cursor: "pointer",
        }}
      >
        Close
      </button>
      <div>{children}</div>
    </div>
  );
}
